package com.tengjie.base.common.dynamicjsp.element;import java.util.List;public class JspAttribute{    private boolean ifStatic;    private boolean ifContainElExpress;    private String tableName;    private String attrName;    private String attrOriginValue;    private String attrCovertValue;    private Integer loadFieldNum;    private List<String> multiLieldName;    protected String jspToolFunctionName;    protected Object selectDataCollection;    protected String selectDataType;    public JspAttribute(boolean ifStatic, String tableName, String attrName, String attrOriginValue, String attrCovertValue)    {        this.ifStatic = ifStatic;        this.tableName = tableName;        this.attrName = attrName;        this.attrOriginValue = attrOriginValue;        this.attrCovertValue = attrCovertValue;    }    public String getAttrName()    {        return this.attrName;    }    public void setAttrName(String attrName)    {        this.attrName = attrName;    }    public String getAttrOriginValue()    {        return this.attrOriginValue;    }    public void setAttrOriginValue(String attrOriginValue)    {        this.attrOriginValue = attrOriginValue;    }    public String getAttrCovertValue()    {        return this.attrCovertValue;    }    public void setAttrCovertValue(String attrCovertValue)    {        this.attrCovertValue = attrCovertValue;    }    public Integer getLoadFieldNum()    {        return this.loadFieldNum;    }    public void setLoadFieldNum(Integer loadFieldNum)    {        this.loadFieldNum = loadFieldNum;    }    public List<String> getMultiLieldName()    {        return this.multiLieldName;    }    public void setMultiLieldName(List<String> multiLieldName)    {        this.multiLieldName = multiLieldName;    }    public JspAttribute() {}    public static JspAttribute newInstance()    {        return new JspAttribute();    }    public String getTableName()    {        return this.tableName;    }    public void setTableName(String tableName)    {        this.tableName = tableName;    }    public String getJspToolFunctionName()    {        return this.jspToolFunctionName;    }    public void setJspToolFunctionName(String jspToolFunctionName)    {        this.jspToolFunctionName = jspToolFunctionName;    }    public boolean isIfStatic()    {        return this.ifStatic;    }    public void setIfStatic(boolean ifStatic)    {        this.ifStatic = ifStatic;    }    public Object getSelectDataCollection()    {        return this.selectDataCollection;    }    public void setSelectDataCollection(Object selectDataCollection)    {        this.selectDataCollection = selectDataCollection;    }    public String getSelectDataType()    {        return this.selectDataType;    }    public void setSelectDataType(String selectDataType)    {        this.selectDataType = selectDataType;    }    public boolean isIfContainElExpress()    {        return this.ifContainElExpress;    }    public void setIfContainElExpress(boolean ifContainElExpress)    {        this.ifContainElExpress = ifContainElExpress;    }}